s($,"bnU","aOi",()=>{var q,p,o,n,m,l,k,j=A.ac("p<SS>"),i=A.b([A.bp("SolFight is a player-vs-player trading arena built on Solana. Instead of trading against the market alone, you compete head-to-head against another trader. Both players start with the same virtual balance and trade the same assets (BTC, ETH, SOL) over a fixed timeframe. The player with the higher portfolio ROI at the end wins the match and takes the prize pool.","Trading as a Competition"),A.bp("You choose a timeframe (15 minutes to 24 hours) and a bet amount in USDC. The system matches you with an opponent who chose the same timeframe and bet. Once matched, you both enter the Arena \u2014 a real-time trading interface with live price feeds, charting tools, and a chat window. You can go long or short on BTC, ETH, or SOL with up to 50x leverage.","How Matches Work"),A.bp("Both players deposit their bet amount into a Solana escrow smart contract before the match starts. The winner receives 90% of the total pool (their own bet + 90% of the opponent's bet). The remaining 10% goes to the SolFight protocol. For example, in a $25 match, the winner walks away with $47.50.","The Prize Pool"),A.bp("Traditional trading can feel isolating. SolFight adds a competitive layer \u2014 you're not just trying to make money, you're trying to outperform a real human opponent under the same market conditions. It's like chess, but with candlestick charts. Your skill, strategy, and risk management directly determine the outcome.","Why SolFight?")],j),h=t.s
i=A.fi("gs_1",A.b(["SolFight is PvP trading \u2014 you compete against another human, not the house.","Both players trade the same assets with the same starting balance.","Winner takes 90% of the combined prize pool.","Matches range from 15 minutes to 24 hours."],h),3,i,"The PvP trading arena on Solana","What is SolFight?")
q=A.b([A.bp("SolFight supports Phantom, Solflare, Backpack, and any Solana-compatible browser wallet. Phantom is the most popular choice and works as a Chrome extension or mobile app. You'll need your wallet to sign transactions, deposit USDC into escrow, and receive winnings.","Supported Wallets"),A.bp("1. Click the \"Connect Wallet\" button in the top bar.\n2. Choose your wallet provider from the modal.\n3. Approve the connection request in your wallet extension.\n4. Your wallet address and USDC balance will appear in the top bar.\n\nThat's it \u2014 you're now authenticated and ready to queue for matches.","Connecting Step-by-Step"),A.bp("SolFight currently runs on Solana Devnet, so you need Devnet USDC (not real money). You can get free Devnet SOL from a faucet like faucet.solana.com, then swap it for Devnet USDC using the platform's built-in deposit flow. This lets you practice and compete without risking real funds.","Getting Devnet USDC")],j)
q=A.fi("gs_2",A.b(["Phantom is the recommended wallet for beginners.","Connecting takes ~30 seconds \u2014 just approve the popup.","We're on Devnet, so all funds are free test tokens."],h),2,q,"Set up Phantom or Solflare in 2 minutes","Connecting Your Wallet")
p=A.b([A.bp("On the Play screen, you'll see five timeframe options: 15 minutes, 1 hour, 4 hours, 12 hours, and 24 hours. Shorter timeframes are more action-packed and require quick decisions. Longer timeframes let you ride trends and think more strategically. Start with 15-minute or 1-hour matches to learn the ropes.","Choosing a Timeframe"),A.bp('Select your timeframe, choose a bet amount, and click "Join Queue." The matchmaking system will pair you with an opponent who selected the same timeframe and bet. Queue times depend on how many players are active \u2014 popular timeframes like 15m and 1h usually match within seconds.',"Joining the Queue"),A.bp("When an opponent is found, you'll see their gamer tag and a countdown to deposit your bet into the Solana escrow. Approve the transaction in your wallet \u2014 once both players deposit, the match begins immediately and you're taken to the Arena.","The Opponent Found Screen"),A.bp("The Arena shows a live price chart, your portfolio (balance + open positions), and your opponent's ROI. Use the order panel on the right to open long or short positions. You can set leverage, stop-loss, and take-profit levels. At the end of the timeframe, all positions auto-close and the player with the higher ROI wins.","Arena Basics")],j)
p=A.fi("gs_3",A.b(["Start with 15m or 1h matches to learn quickly.","Queue times are shortest during peak hours.","Both players must deposit before the match starts.","The Arena auto-closes all positions when time runs out."],h),3,p,"Join a queue and enter the Arena","Your First Match")
o=A.b([A.bp("The center of the Arena is a real-time TradingView chart showing the selected asset's price. You can switch between BTC, ETH, and SOL using the asset tabs above the chart. The chart updates every second with live market data. Use it to identify trends, support/resistance levels, and entry points.","The Price Chart"),A.bp('On the right side (or in the "Trade" tab on mobile), you\'ll find the order panel. Here you can:\n- Choose Long (bet price goes up) or Short (bet price goes down)\n- Set your position size using percentage buttons (25%, 50%, 75%, MAX)\n- Choose leverage (1x to 50x)\n- Set optional Stop Loss and Take Profit prices\n- Click "Open Long" or "Open Short" to execute',"The Order Panel"),A.bp('Below the chart (desktop) or in the "Positions" tab (mobile), you can see your open positions with live P&L, and your closed trades history. Each position shows the asset, direction, entry price, size, leverage, and current unrealized P&L. You can manually close any position at any time by clicking the X button.',"Open Positions & Closed Trades"),A.bp("The Arena toolbar at the top shows:\n- Match timer (countdown to match end)\n- Your opponent's gamer tag and ROI\n- Your portfolio balance and equity\n- A chat button (desktop) to message your opponent\n\nKeep an eye on the timer \u2014 when it hits zero, all positions auto-close and the winner is decided.","The Toolbar")],j)
n=A.ac("p<lW>")
o=A.SP(B.S,"Everything you need to start competing on SolFight.",B.P4,"getting_started",A.b([i,q,p,A.fi("gs_4",A.b(["Switch between BTC, ETH, SOL using the asset tabs.","Use percentage buttons for quick position sizing.","Monitor both your P&L and your opponent's ROI in the toolbar.","Positions auto-close when the match timer reaches zero."],h),4,o,"Navigate charts, orders, and positions","Understanding the Arena UI")],n),"BEGINNER","Getting Started")
p=A.b([A.bp("A candlestick represents price movement over a specific time period. Each candle has four data points: Open (where the price started), Close (where it ended), High (the highest price reached), and Low (the lowest). A green candle means the price closed higher than it opened (bullish). A red candle means it closed lower (bearish).","What is a Candlestick?"),A.bp('The thick part of the candle is called the "body" \u2014 it shows the range between open and close. The thin lines extending above and below are "wicks" (or shadows) \u2014 they show the high and low extremes. A long wick means the price was rejected at that level. A candle with a small body and long wicks signals indecision.',"The Body and Wicks"),A.bp("Doji: Tiny body, long wicks \u2014 market is undecided. Often appears before reversals.\nHammer: Small body at the top, long lower wick \u2014 sellers pushed the price down but buyers fought back. Bullish reversal signal.\nEngulfing: A large candle that completely covers the previous candle's body. Bullish engulfing = buyers taking over. Bearish engulfing = sellers taking over.\nMorning Star: Three-candle reversal pattern \u2014 bearish candle, small indecision candle, then a strong bullish candle.","Key Candlestick Patterns"),A.bp("In a 15-minute match, each 1-minute candle matters. Look for reversal patterns near support or resistance to time your entries. In longer matches (4h+), zoom out and use hourly candles to identify the broader trend before zooming in for precise entries.","Using Candles in SolFight")],j)
p=A.fi("ca_1",A.b(["Green = bullish (price went up), Red = bearish (price went down).","Long wicks show price rejection \u2014 important reversal signals.","Learn to spot Doji, Hammer, and Engulfing patterns.","Match your candle timeframe to your match duration."],h),4,p,"The building blocks of every chart","Candlestick Basics")
q=A.b([A.bp("Support is a price level where buying pressure consistently prevents the price from falling further. Think of it as a floor \u2014 the price bounces off it. Support forms because traders remember that the price reversed at that level before, so they place buy orders there. The more times a level holds, the stronger the support.","What is Support?"),A.bp("Resistance is the opposite \u2014 a ceiling where selling pressure stops the price from rising. Traders who bought lower take profits at resistance, and short sellers enter positions there. When price approaches resistance, expect it to slow down or reverse. A strong resistance level that has held multiple times is harder to break.","What is Resistance?"),A.bp('When price finally breaks through support or resistance with strong volume, it\'s called a breakout (up through resistance) or breakdown (down through support). These are powerful trading signals. The old resistance often becomes new support after a breakout, and vice versa. This "flip" is one of the most reliable patterns in trading.',"Breakouts and Breakdowns"),A.bp("Before opening any position, identify the nearest support and resistance levels on the chart. Go long near support (with a stop loss just below). Go short near resistance (with a stop loss just above). If you see a breakout, ride the momentum. These levels give you an edge by defining clear entry, exit, and risk points.","Applying to SolFight Matches")],j)
q=A.fi("ca_2",A.b(["Support = floor (price bounces up), Resistance = ceiling (price bounces down).","The more times a level holds, the stronger it is.","Broken resistance becomes new support (and vice versa).","Always trade with nearby support/resistance in mind."],h),4,q,"Find the levels where price reacts","Support & Resistance")
i=A.b([A.bp('An uptrend is defined by a series of higher highs and higher lows. Each peak is higher than the last, and each dip doesn\'t go as low as the previous one. As long as this pattern holds, the trend is bullish. In an uptrend, favor long positions \u2014 "the trend is your friend."',"Higher Highs, Higher Lows"),A.bp('A downtrend is the opposite \u2014 each peak is lower, and each dip goes deeper. This means sellers are in control. In a downtrend, favor short positions. Don\'t try to "catch the falling knife" \u2014 wait for a confirmed reversal before going long.',"Lower Highs, Lower Lows"),A.bp("When price bounces between a clear support and resistance without making new highs or lows, it's ranging. In a range, you can buy at support and sell at resistance (mean-reversion strategy). Ranges eventually break \u2014 the breakout direction often leads to a strong move.","Sideways (Range-Bound) Markets"),A.bp("Before a match starts, quickly assess the current trend on the 1-hour and 15-minute charts. If there's a clear uptrend, lean towards long positions. If it's a downtrend, lean short. If it's ranging, play the bounces between support and resistance. Having a directional bias from the start gives you a plan instead of random trades.","Trend Trading in SolFight")],j)
i=A.fi("ca_3",A.b(["Uptrend: higher highs + higher lows. Favor longs.","Downtrend: lower highs + lower lows. Favor shorts.","Range: play the bounces or wait for breakout.","Identify the trend BEFORE the match starts."],h),3,i,"Determine if the market is going up, down, or sideways","Trend Identification")
m=A.b([A.bp("Volume measures how much of an asset is being traded. High volume on a price move confirms that the move is real \u2014 many traders agree on the direction. Low volume moves are suspicious and more likely to reverse. Think of volume as conviction: loud crowds (high volume) mean the move has legs.","Why Volume Matters"),A.bp("If price is making new highs but volume is decreasing, it's a warning sign \u2014 the uptrend is losing steam. This is called bearish divergence. Conversely, if price makes new lows on declining volume, sellers might be exhausted, signaling a potential bottom. Always compare price action with volume for the full picture.","Volume Divergence"),A.bp("RSI (Relative Strength Index) measures how fast price is moving. Above 70 = overbought (may reverse down). Below 30 = oversold (may reverse up). MACD shows momentum direction changes \u2014 when the MACD line crosses above the signal line, it's bullish. These indicators won't be on the SolFight chart by default, but understanding their logic helps you read raw price action.","Momentum Indicators")],j)
m=A.SP(B.cI,"Read price charts like a pro trader.",B.P3,"chart_analysis",A.b([p,q,i,A.fi("ca_4",A.b(["High volume confirms price moves; low volume signals caution.","Price + falling volume = weakening trend (divergence).","RSI above 70 = overbought, below 30 = oversold.","Use momentum concepts even without explicit indicators."],h),3,m,"Confirm moves with trading activity","Volume & Momentum")],n),"FUNDAMENTALS","Chart Analysis")
i=A.b([A.bp("When you go long, you profit when the price goes up. You buy at a lower price and aim to sell higher. In SolFight, opening a long position is a bet that the asset's price will increase during the match. Example: BTC is at $60,000, you go long with 10x leverage and $100 size. If BTC rises 1%, your position gains $100 (10x your collateral's 1% move = 10% return).","Going Long"),A.bp("When you go short, you profit when the price drops. You're essentially selling first and buying back later at a lower price. In SolFight, shorting is a bet that the asset will decline. Example: ETH is at $3,000, you short with 5x leverage and $200 size. If ETH drops 2%, your position gains $200 (5x * 2% = 10% return on your collateral).","Going Short"),A.bp("Long when: the trend is bullish, price just bounced off support, or you see bullish reversal candles. Short when: the trend is bearish, price just hit resistance, or bearish candles form. In SolFight, being able to profit in both directions is your biggest advantage \u2014 you're never stuck waiting for the market to go one way.","When to Long vs Short")],j)
i=A.fi("st_1",A.b(["Long = profit when price goes up. Short = profit when price goes down.","Leverage amplifies both gains AND losses.","Always trade in the direction of the trend when possible.","Being able to short is a massive advantage over buy-and-hold investors."],h),3,i,"Profit in both directions","Long vs Short")
q=A.b([A.bp("Scalping means making many small, fast trades to capture tiny price movements. Instead of one big trade, you might make 5-10 trades during a 15-minute match. Each trade targets a small gain (0.1-0.5%), but with leverage, these add up. Scalpers don't hold positions long \u2014 they get in, take profit, and move on.","What is Scalping?"),A.bp("Use higher leverage (10-25x) with small position sizes so a quick 0.1-0.3% move gives meaningful profit. Set tight stop losses (cut losers fast) and take profits quickly. Watch the 1-minute candles closely. Enter on bounces at micro-support levels or on small breakouts.","Scalping Setup"),A.bp("In a 15-minute SolFight match, scalping is the dominant strategy. You don't have time for big trends to develop \u2014 you need quick wins. Open a position, set a tight TP, close it within 1-2 minutes, then look for the next trade. The player who makes more correct micro-decisions wins.","Scalping in 15m Matches"),A.bp("Don't overtrade \u2014 if you're not seeing clear setups, wait. Don't use MAX leverage with your full balance \u2014 one bad trade wipes you out. Don't hold a losing scalp hoping it will recover \u2014 close it and find a new entry. Speed is important, but discipline is more important.","Common Mistakes")],j)
q=A.fi("st_2",A.b(["Scalping = many small, fast trades with leverage.","Best for 15m and 1h matches.","Cut losses fast, take profits quickly.","Discipline > speed. Don't overtrade."],h),4,q,"Quick trades, quick profits","Scalping (Short Timeframes)")
p=A.b([A.bp("Swing trading means holding positions for a longer period to capture larger price moves. In SolFight, this applies to 4h, 12h, and 24h matches. Instead of making 10 small trades, you might make 1-3 well-chosen positions and let them ride. The goal is to identify the dominant trend and position yourself early.","What is Swing Trading?"),A.bp("Use moderate leverage (2-10x) with larger position sizes. Identify the trend on the hourly chart, then wait for a pullback to enter. Set wider stop losses (give the trade room to breathe) and wider take profits (capture the full move). Patience is key \u2014 don't panic-close on small pullbacks.","Swing Setup"),A.bp("In longer matches, consider splitting your balance across BTC, ETH, and SOL. If BTC is trending up and SOL is ranging, go long BTC and play SOL's range. This reduces your dependency on a single asset and smooths out your P&L.","Multi-Asset Diversification")],j)
p=A.fi("st_3",A.b(["Swing trading = fewer trades, bigger moves, more patience.","Best for 4h, 12h, and 24h matches.","Use moderate leverage and wider stops.","Consider diversifying across multiple assets."],h),3,p,"Ride the bigger moves","Swing Trading (Long Timeframes)")
l=A.b([A.bp("Leverage multiplies your position size relative to your collateral. With 10x leverage, a $100 position controls $1,000 worth of the asset. A 1% price move becomes a 10% gain or loss on your collateral. SolFight offers 1x to 50x leverage.","What Leverage Does"),A.bp("Higher leverage means a smaller price move can liquidate you (lose your entire position). At 50x leverage, a mere 2% adverse move wipes out your position. At 10x, it takes 10%. At 2x, it takes 50%. Many beginners max out leverage and get liquidated on normal market noise. Don't be that person.","The Liquidation Trap"),A.bp("15-minute matches: 10-25x (price won't move much, you need leverage to generate returns)\n1-hour matches: 5-15x (moderate volatility)\n4+ hour matches: 2-10x (longer time = bigger moves = lower leverage needed)\n\nA useful rule: the longer the match, the lower the leverage. Let time create the returns instead of leverage.","Recommended Leverage by Match Type")],j)
l=A.SP(B.bP,"Proven approaches for different match timeframes.",B.rl,"strategies",A.b([i,q,p,A.fi("st_4",A.b(["Leverage amplifies BOTH gains and losses.","Higher leverage = closer liquidation price.","Short matches: higher leverage. Long matches: lower leverage.","Never go 50x with your full balance \u2014 leave room for error."],h),3,l,"Amplify without destroying","Using Leverage Wisely")],n),"INTERMEDIATE","Trading Strategies")
p=A.b([A.bp("Never risk more than 20-30% of your match balance on a single trade. If you put 100% into one position and it goes wrong, the match is over. By keeping individual positions small, you can take multiple shots at winning. Even if 2 out of 5 trades fail, the remaining 3 can carry you to victory.","The Golden Rule"),A.bp("The Arena has quick buttons: 25%, 50%, 75%, and MAX. For most situations, 25% is the safest starting size. 50% is aggressive but acceptable. 75% and MAX should only be used when you have extremely high conviction \u2014 like a clear breakout with volume confirmation. Start small, scale up as you gain confidence.","The 25/50/75/MAX Buttons"),A.bp("Instead of one 50% position on BTC, consider two 25% positions on BTC and ETH. If both assets are trending the same way, you benefit from both. If one underperforms, the other might compensate. Diversification within a match reduces the impact of any single bad trade.","Splitting Across Assets")],j)
p=A.fi("rm_1",A.b(["Never risk more than 20-30% per trade.","Start with the 25% button and scale up with conviction.","Spread across assets to reduce single-trade risk.","Surviving to make more trades is more important than one big win."],h),3,p,"How much to risk per trade","Position Sizing")
q=A.b([A.bp("A stop loss automatically closes your position if the price moves against you by a set amount. Without one, a small loss can snowball into a liquidation. Setting a stop loss is the single most important risk management tool. It removes emotion from the equation \u2014 the system exits for you when the trade is wrong.","Why Stop Losses Matter"),A.bp("Place your stop loss below the nearest support (for longs) or above the nearest resistance (for shorts). Don't set it too tight (you'll get stopped out by normal noise) or too wide (you'll lose too much before it triggers). A good rule: your stop should be at a level where, if hit, your trade thesis is clearly wrong.","Setting Effective Stop Losses"),A.bp("A take profit automatically closes your position when it reaches a target gain. Aim for a reward-to-risk ratio of at least 2:1. If your stop loss risks $50, your take profit should target at least $100. This way, you only need to be right 40% of the time to be profitable overall.","Take Profit Targets")],j)
q=A.fi("rm_2",A.b(["Always set a stop loss \u2014 no exceptions.","Place stops below support (longs) or above resistance (shorts).","Aim for 2:1 or better reward-to-risk ratio.","Take profits let you lock in gains without watching the screen."],h),3,q,"Automate your exits","Stop Losses & Take Profits")
i=A.b([A.bp("Beyond individual trades, think about your total USDC balance across all matches. Don't bet your entire balance on a single match. If you have $100, consider playing $10-$25 matches. This gives you 4-10 opportunities to win. Even the best traders lose sometimes \u2014 bankroll management ensures you survive the losing streaks.","Your Overall Balance"),A.bp('Only move to higher bet amounts when your win rate consistently proves you\'re profitable. A rough guide:\n- Start at the lowest bet amount available.\n- After 10+ matches with a positive win rate, consider moving up one level.\n- After a losing streak (3+ losses), drop back down.\n\nThis "grinding up" approach protects your bankroll while allowing growth.',"Moving Up in Stakes"),A.bp('After a loss, you\'ll feel the urge to immediately queue again with a bigger bet to "win it back." This is tilt \u2014 emotional decision-making. It almost always leads to bigger losses. After a loss, take a 5-minute break. Review what went wrong. Then decide calmly whether to play again.',"Tilt Control")],j)
i=A.fi("rm_3",A.b(["Never bet more than 25% of your total balance on one match.","Move up stakes only after proven profitability.","Drop down after losing streaks.","Recognize and control tilt \u2014 take breaks after losses."],h),3,i,"Think long-term across matches","Bankroll Management")
k=A.b([A.bp('Fear makes you close winning trades too early and hesitate on good setups. Greed makes you hold losing trades too long and overleverage. Recognizing these emotions in real-time is a skill that separates winning traders from losing ones. Before every trade, ask: "Am I making this decision based on analysis or emotion?"',"Fear and Greed"),A.bp("Enter every match with a plan: What's the current trend? Which assets look strongest? What leverage will I use? What's my max position size? Having a plan prevents impulsive decisions. You don't need to predict the market \u2014 you just need a framework for reacting to what happens.","The Plan Before the Match"),A.bp("Losses are part of trading. Even the best SolFight players lose 30-40% of their matches. What makes them profitable is that their wins are bigger than their losses (thanks to good risk management and reward-to-risk ratios). Accept that some matches are unwinnable \u2014 the market moved against you, the opponent got lucky, or your read was wrong. Move on.","Accepting Losses")],j)
k=A.SP(B.G,"Protect your capital and survive to win.",B.f4,"risk_management",A.b([p,q,i,A.fi("rm_4",A.b(["Emotion is the enemy \u2014 trade based on analysis, not feelings.","Have a plan before every match starts.","Losing is normal \u2014 focus on making wins bigger than losses.","Review every match afterward to improve."],h),3,k,"Your biggest opponent is yourself","Psychology of Trading")],n),"ESSENTIAL","Risk Management")
i=A.b([A.bp("The Arena toolbar shows your opponent's ROI in real-time. If they're up big, they might become conservative \u2014 protecting their lead. If they're down, they might take aggressive risks. Use this information to adjust your strategy. When you're ahead, play defense. When you're behind, take calculated risks.","Opponent ROI Tracking"),A.bp("You can see how many open positions your opponent has. If they have 0, they might be waiting for an entry or conserving their lead. If they have multiple positions, they're spreading risk. A sudden increase in positions might mean they're making a big move to catch up.","Position Count Signals"),A.bp('The Arena chat lets you communicate with your opponent. Some players try to psych you out or distract you. Stay focused on your charts and strategy. You can also use chat strategically \u2014 a confident "GL" at the start can set the tone, but don\'t let trash talk affect your decisions.',"Chat Mind Games")],j)
i=A.fi("ad_1",A.b(["Monitor opponent ROI to adapt your aggression level.","When ahead, play defensive. When behind, take calculated risks.","Opponent position count reveals their strategy.","Don't let chat distract you from the charts."],h),3,i,"Use the Arena info to your advantage","Reading Your Opponent")
q=A.b([A.bp("BTC, ETH, and SOL are correlated but not identical. BTC leads the market \u2014 when BTC makes a big move, ETH and SOL usually follow. However, SOL is more volatile and often moves more in percentage terms. ETH sits in the middle. Understanding these relationships helps you choose which asset to trade at any moment.","Asset Correlation"),A.bp("During a match, don't commit to one asset. Start by watching all three. If BTC breaks out of a range, SOL will likely follow with a bigger move \u2014 open your position on SOL for amplified returns. If the market is choppy, look for the one asset showing the clearest trend and focus there.","Rotation Strategy"),A.bp("In longer matches, you can hedge by going long on one asset and short on another. If BTC is showing strength relative to SOL, go long BTC and short SOL. This way, even in a market-wide dump, your BTC position loses less than your SOL short gains. This advanced technique reduces directional risk.","Hedging Across Assets")],j)
q=A.fi("ad_2",A.b(["SOL is most volatile, BTC is most stable, ETH is in between.","When BTC leads, SOL follows with bigger moves.","Focus on the asset with the clearest signal.","Hedging (long one, short another) reduces overall risk."],h),3,q,"Trade the strongest mover","Multi-Asset Rotation")
p=A.b([A.bp("Mean reversion is the tendency of price to return to its average after an extreme move. When price spikes too far too fast (overbought), it often pulls back. When it dumps too hard (oversold), it often bounces. This strategy profits from these corrections \u2014 you're betting that extremes don't last.","The Core Idea"),A.bp("Look for: Sudden large candles with long wicks (overextension). Price far from the moving average. Multiple consecutive candles in one direction (exhaustion). In a 15m match, even a 0.5% spike can be an overreaction in crypto. Enter a counter-trade with tight stops above the extreme.","Identifying Extremes"),A.bp("Don't fade a strong trend just because it \"looks overextended.\" If BTC is breaking out above major resistance on huge volume, that's a real move, not an overreaction. Mean reversion works best in ranging markets or during low-volume spikes. In strong trends, trade WITH the momentum instead.","When NOT to Mean-Revert")],j)
p=A.fi("ad_3",A.b(["Mean reversion = bet that overreactions will correct.","Works best in ranging, choppy markets.","Don't fight strong trends with real volume behind them.","Use tight stops when mean-reverting \u2014 you're trading against momentum."],h),3,p,"Profit from overreactions","Mean Reversion")
j=A.b([A.bp("If you're ahead with 5 minutes left, your goal shifts from making money to not losing your lead. Close risky positions. Reduce leverage. Move to cash if your lead is comfortable. Your opponent will be forced to take big risks \u2014 let them make mistakes while you play it safe.","Managing a Lead"),A.bp("If you're behind with time running out, you need to take bigger swings. Increase leverage slightly, look for the highest-conviction setup, and go for it. But don't blindly max leverage on a coin flip \u2014 even when behind, identify a real setup. A well-timed reversal trade with higher leverage can close a big gap quickly.","Comeback Strategy"),A.bp("In the last minute, positions auto-close at match end. If you're ahead, consider closing all positions manually to lock in your exact P&L (in case a sudden price swing before auto-close hurts you). If you're behind, keep your positions open \u2014 you need the volatility to close the gap. The endgame is where matches are won and lost.","The Final 60 Seconds")],j)
return A.b([o,m,l,k,A.SP(B.p,"Pro-level strategies to dominate the Arena.",B.da,"advanced",A.b([i,q,p,A.fi("ad_4",A.b(["When ahead: reduce risk, protect the lead.","When behind: increase conviction, not recklessness.","Consider closing manually before auto-close if you're winning.","The last few minutes are the most decisive \u2014 stay focused."],h),3,j,"Win the final minutes","Match Endgame Tactics")],n),"ADVANCED","Advanced Tactics")],A.ac("p<y1>"))})
